function fixForUri($string){
    $slug = trim($string);
    $slug= preg_replace('/[^a-zA-Z0-9 -]/','',$slug );
    $slug= str_replace(' ','-', $slug);
    $slug= strtolower($slug); 
    return $slug;
}

