                <h3 style="text-align: center; color: #20255b; font-size: 9pt;">BOLETIM SUSTENTÁVEL DE PROCESSAMENTO E REUTILIZAÇÃO DE RESÍDUOS DA CONSTRUÇÃO CIVIL</h3>
                <p style="font-size: 9pt; text-align: justify;">Utilizando o conceito de Economia Circular, a Riomix Argamassa, em parceria com a PUC-RJ, desenvolveu através de diversos estudos de comportamento, mecânicos e de durabilidade, a melhor forma para transformar e adicionar sua embalagem, outrora descartadas pelos seus clientes, em sua composição, originando a Celumassa: a argamassa aditivada de fibras de celulose provenientes da reciclagem da sua própria embalagem.</p>
                <p style="font-size: 9pt; text-align: justify;">Fazendo uso dos produtos Riomix da linha Celumassa a obra se <strong>habilita imediatamente como destinação final adequada</strong> para as embalagens do próprio produto, pois não se trata de um descarte e sim de uma <strong>embalagem retornável</strong> reutilizada como insumo. Com isso, reduz seu custo de disposição final de RCC (da ordem de 60 a 80 centavos por saco) defletindo volume do mesmo para aterros sanitários, de uma forma mais <strong>econômica</strong> e <strong>sustentável</strong>.</p>
                <p style="font-size: 9pt; text-align: justify;">Responsabilidade Social: Com o Programa Emboço Social (PES), cada embalagem devolvida tem um valor muito maior do que se possa imaginar, esse simples ato está trazendo mais proteção, saúde e dignidade através do emboço externo para os lares de inúmeras famílias brasileiras.</p>
                <p style="font-size: 9pt; text-align: justify;">A utilização da <strong>logística reversa</strong> pela obra <strong>evita</strong> que a mesma <strong>emita GEE</strong>, na ordem de 115 kg de CO2eq por caçamba transportada para aterros sanitários. Com isso, a cada <strong>10 caçambas, 9 árvores</strong> deveriam ser plantadas para neutralizar o CO2eq gerado no descarte das mesmas.</p>
                <p style="font-size: 9pt; text-align: justify;">Foram recebidas do empreendimento <strong>' . $name . '</strong> localizado na <strong>' . $cert_location . '</strong>, o volume de sacaria conforme tabela abaixo:</p>
                <p style="font-size: 9pt; text-align: justify;">
